import React from 'react';
import jamBookerLogo from '../../assets/logo.jpg';
import './logo.css';
import { NavLink } from 'react-router-dom';

const logo = () => (
    <React.Fragment>
        <NavLink className='logo' to='/'>
            <img src={jamBookerLogo} alt="MyBurger" />
            <NavLink className='logo-text' to='/'>
                Jam Booker \m/
    </NavLink>
        </NavLink>

    </React.Fragment>
);

export default logo;
